import { useState } from "react";
import Questions from "./Question";

const Quiz = () => {

const [currentQuetionIndex, setCurrentQuestionIndex] = useState(0);
const testClick = () => {
    setCurrentQuestionIndex(currentQuetionIndex + 1);
}

    return (
        <div className="quiz">
            <div>
                <div className="score">Question 1/8</div>
                <Questions />
                <div className="next-button" onClick = {testClick}>Next question{currentQuetionIndex} </div>
            </div>
 
        </div>
    );
}

export default Quiz;
